INSERT INTO `articles` (`id`, `external`, `url`, `imgurl`, `pubdate`, `title`, `synopsis`, `body`, `lastmodified`) VALUES
(1, 0, 'news/2014-01-25/first-spring-practice', 'img/photo/nova.jpg', '2014-01-25', 'First Spring Practice', 'NOVA Men''s Rugby will be holding its first Spring Practice on 11 February 2014 at 8:30PM at Oakton High School.', '<p> NOVA Men''s Rugby will be holding its first Spring Practice on 11 February 2014 at 8:30PM at Oakton High School (see below details).  If you haven''t started pre-season conditioning, now is the time to get going so that we can hot the ground running and prepare for our upcoming matches.\r\n\r\n<p> Who:  All NOVA Players and Coaches\r\n<br> What: First Spring Practice\r\n<br> Where: <a href="https://www.google.com/maps/preview/place/Oakton+High+School/@38.8784621,-77.2816203,17z/data=!4m2!3m1!1s0x0:0xadbf7ab1176ff030">Oakton High School, Vienna, VA</a>\r\n<br> When:  Tuesday, 11 February 2014 @ 8:30PM\r\n\r\n<p> GO NOVA!', '2014-02-01 05:03:45'),
(2, 0, 'news/2013-07-20/nova-heading-to-nationals', 'img/photo/nova.jpg', '2013-07-20', 'NOVA heading to Nationals', 'NOVA qualified for a trip to the Nationals Aug 10, by defeating Norfolk 33-5 in the semi-finals.', '<p> The report from Norfolk and the MARFU 7s championships is a great one.\r\nNOVA qualified for a trip to the Nationals Aug 10, by defeating Norfolk 33-5 in the semi-finals.\r\n<p> Unfortunately, we lost 19-5 to Schuylkill River in the finals, but that was with a yellow and a red card against us for much of the game.\r\n<p> A big thanks to all the guys who went down today, including our 7 brave lads from the Open side who competed without substitutions and still kept fighting.\r\n<p> We will need that kind of effort as we prepare for Nationals in Pittsburgh the weekend of Aug. 10.\r\n<p> Congrats and thanks for doing the club proud\r\n<p> - Weasel\r\n', '2014-02-01 05:04:53'),
(3, 0, 'news/2013-06-05/nova-old-grays-win', 'img/photo/Old_Gray_vs_Roosters_Spring_2013.jpg', '2013-06-05', 'NOVA Old Grays Win', 'NOVA Old Boys trounce Roosters.', '<p>Several current NOVA players travelled out to "The Farm" to watch the Old Boys take on the Roosters.</p>\r\n<p>"The Farm" offered a family atmosphere that welcomed significant others and kids.  They also provided free beer and food for the degenerates this club willingly accepts.  This was a great opportunity to watch some good rugby and socialize with our Fore Fathers.</p>\r\n<p>The Old Boys dominated from the get go and Phantom scored an early try, the first of his hat trick.  The Forwards dominated the game and had 2 push over tries from 5 meter scrums.</p>\r\n<p>Some of our current players and coaches participated in the game and was fun to watch them get worked (Joey Chops Koko Quick Tap Too Tuff, Floody, and Prince). Weasel and BG were also there in support but everyone avoided them.</p>\r\n<br></br>\r\n<p>Here is the writeup from our Old Boy contingent:</p>\r\n<p>"Thanks to all the players, families, friends, NOVA players, NOVA alum, who came out to the match yesterday! You all make a bunch of old guys feel young again and are helping to grow the Old Gray both on the pitch and off.</p>\r\n<p>The interest in the club and growth this spring has been fantastic! Each match brings out a few more guys to shake off the rust and a few more alum to laugh at how the mighty have fallen. It is becoming a pleasure to schedule these events as we no longer have to hold our breath in hopes of having enough players show up.</p>\r\n<p>Our play on the field has been strong and determined. Our forwards often run like our oppositions backs and our backs tackle and ruck with reckless abandon. The play is selfless and the ball moves quickly during all phases of play. My lack of rugby knowledge and english skills have brought me to the end of my pontificating."</p>\r\n<br></br>\r\n<p>Thanks to all that came out, I hope that we can continue to support our Old Boys and enjoy great days like this.</p>\r\n', '2014-02-01 04:49:24'),
(4, 0, 'news/2013-05-30/watch-usa-v-ire-on-08-june 2013-730pm', 'img/photo/nova.jpg', '2013-05-30', 'RECRUITING EVENT: Watch USA v IRE on 08 June 2013 @ 7:30PM', 'We will be watching the USA v IRE test match at O''Sullivans bar and use that opportunity to promote the club and recruit new talent.', '<p>\r\nNOVA,\r\n</p>\r\n<p>\r\nIn response to the need to increase recruiting efforts, we have decided to hold a recruiting event in Virginia as a way to attract new players and talent to the team.  We will be watching the USA v IRE test match at O''Sullivans bar and use that opportunity to promote the club and recruit new talent.  Also, in order to boost the reach of this event, if you have a Facebook account, please go to this EVENT and "join" it  (<a href="https://www.facebook.com/events/105276996349116/">https://www.facebook.com/events/105276996349116/</a>).\r\n</p>\r\n<p>\r\n<b>Details:</b><br>\r\n \r\n<b>Date:</b> 08 June 2013<br>\r\n<b>Time:</b> 5:00-9:00PM<br>\r\n<b>Location:</b> O''Sullivan''s Irish pub and Restaurant, 3207 Washington Blvd, Arlington, VA<br>\r\n<b>Who:</b> All NOVA Players, Old Boys, friends, and family<br>\r\n<b>What:</b> Watch USA v IRE test match and promote NOVA Rugby<br>\r\n<b>Attire:</b> New NOVA shirts preferred, but any NOVA item of clothing will do\r\n</p>\r\n<p>\r\nI know that this coincides with the Wilmington 7s tournament that day, but it was an opportunity we could not pass up.  Therefore, if you are ARE going to the tournament, please come by when you get back.  If you are NOT going to the tournament, this is as close to a required event as it gets as we need people to come in force.  Please make it a point to come and support the team and any potential players!\r\n</p>\r\n<p>\r\nIf you have any questions/concerns, please let me know.\r\n</p>\r\n<p>\r\nThanks,<br>\r\nJustin Smith<br>\r\nVice President<br>\r\n</p>', '2014-02-04 20:52:19');
